import React from "react"; // Import React from 'react', not ReactDom
import ReactDOM from "react-dom"; // Import ReactDOM for rendering
import  AddExpenseForm from "./AddExpenseForm";
import ExpenseTable from "./App";


ReactDOM.render(
  <React.StrictMode> {/* Wrap your components in StrictMode */}
    <AddExpenseForm />

  </React.StrictMode>,
  document.getElementById("root") // Assuming 'root' is the ID of the element where you want to render your components
);

ReactDOM.render(
  <React.StrictMode> {/* Wrap your components in StrictMode */}
    <ExenseTable/>

  </React.StrictMode>,
  document.getElementById("root1") // Assuming 'root' is the ID of the element where you want to render your components
);
